;eval("define(\"website/router\", \n  [\"ember\",\"website/config/environment\",\"exports\"],\n  function(__dependency1__, __dependency2__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n    var config = __dependency2__[\"default\"];\n\n    var Router = Ember.Router.extend({\n      location: config.locationType\n    });\n\n    Router.map(function() {\n      this.route(\'photography\');\n      this.route(\'design\');\n      this.route(\'programming\');\n      this.route(\'code\');\n      this.route(\'writing\');\n      this.route(\'three-good-things\');\n    });\n\n    __exports__[\"default\"] = Router;\n  });//# sourceURL=website/router.js");

;eval("define(\"website/routes/code\", \n  [\"ember\",\"exports\"],\n  function(__dependency1__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n\n    var projects = [\n      {\n        title: \"Fake Tilt-Shift\",\n        image: \"assets/images/city-mini.jpg\",\n        body: \"This was one of the choices for a final project for my [computational photography class](inst.eecs.berkeley.edu/~cs194-26/fa14/).  It was particularly interesting to me because I used to adore this effect, and have built my own [ghetto tilt-shift lenses](http://cow.mooh.org/projects/tiltshift/diyexamples.html).\\n\\nDoing this in Matlab is slightly different.  The user draws a box for the focus region, and this part stays in focus.  From here, there are two approaches.  The first one blurs the rest of the image in bands corresponding to the distance from the focus region.  The second (more intelligent) way blurs the image corresponding to a rudimentary depth map, and blurs things that have a different depth (where depths have been binned).  The pieces are then blended together using a Gaussian mask.\"\n      },\n\n      {\n        title: \"Project Homeless Connect\",\n        image: \"assets/images/phc.png\",\n        body: \"[Project Homeless Connect](http://www.projecthomelessconnect.com/) is a nonprofit in San Francisco which hosts public events for the 75,000 homeless in San Francisco, where they can get social and medical services.  I\'m working with four others from [Cal Blueprint](http://calblueprint.org) to build an Android app to make the events that they host more efficient by decreasing registration time, preventing loss of sensitive information, and eliminating post-event data entry.\",\n        github: \"https://github.com/calblueprint/PHC\"\n      },\n\n      {\n        title: \"Portkey\",\n        image: \"assets/images/portkey.jpg\",\n        body: \"Portkey is a optimization tool I built while I was an intern at LinkedIn during summer 2014.  A lot of people on my team would create workflows to move metrics data from sources like Kafka onto a Hadoop server, perform some transformations on it, and then store it into a database to query it and update the company dashboard easily.  However, the scheduling software used to write workflows had a poor interface, which made writing workflows take an extremely long time.  I built a better user-interface with autocompletion, intelligent parameter passing, and saved workflows, decreasing workflow composition time by more than 90%.\",\n      },\n\n      {\n        title: \"RapCloud\",\n        image: \"\",\n        body: \"RapCloud was a short hack for this summer\'s LinkedIn Hacker Games.  My friend and I wrote a scraper for rap lyrics, then processed them with a Python script to figure out the most common words and phrases they used, and displayed the data in a word cloud.  It was pretty entertaining.\",\n        github: \"https://github.com/jjwon/rapcloud\"\n      },\n\n      {\n        title: \"Viewfinder\",\n        image: \"assets/images/viewfinder.png\",\n        body: \"Viewfinder was a short hack for a hackathon held last year at Facebook.  It was my first hackathon!  My friend and I built a simple web-app that allows people to check out interesting Instagram photos from different locations.\",\n        github: \"https://github.com/jjwon/Viewfinder\"\n      }\n    ];\n\n    __exports__[\"default\"] = Ember.Route.extend({\n      model: function() {\n        return {\n          projects: projects\n        };\n      }\n    });\n  });//# sourceURL=website/routes/code.js");

