;eval("define(\"website/routes/photography\", \n  [\"ember\",\"exports\"],\n  function(__dependency1__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n\n    __exports__[\"default\"] = Ember.Route.extend({\n    });\n  });//# sourceURL=website/routes/photography.js");

;eval("define(\"website/routes/three-good-things\", \n  [\"ember\",\"exports\"],\n  function(__dependency1__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n\n    var threeGoodThings = [\n      {\n        date: \"12/14/14\",\n        body: \"1.  I spent basically all day today working on my CS 160 final report.  In the end, I\'m quite happy with the way it turned out.  I probably could have just done it in Google Docs, Microsoft Word, or something like that, and just called it a day by putting all the requisite content on the page.  But instead I decided to grind it out and draw up the PDF in Adobe Illustrator (argh I really should get InDesign and learn that for things like this...).  Despite it being a big struggle and taking the majority of this day (8+ hours), I think the final result looks pretty great and I\'m proud that I stuck through with it, especially since I was really dissatisfied with the quality of the rest of our project (code, presentation, etc).\\n2.  Sometime this afternoon I got up and stretched, and felt really sore.  It\'s a nice reminder that (hopefully) working out will pay off dividends.\\n3.  A friend who I sort of gave up on and pinned as someone who only reaches out when it\'s necessary or convenient got boba with me.  Maybe I jumped to conclusions a little too fast.\",\n        note: \"I haven\'t been updating this too much in the past few days, which is kind of bad because part of the point of this exercise is to look introspectively into your life and find three good things that happen every day.  However, the past few days both haven\'t been that great (and I kind of forgot about this).  At this point, I feel like I\'ve actually learned a lot from this short experiment, so I\'ll try to write something up soon about it.\"\n      },\n\n      {\n        date: \"12/10/14\",\n        body: \"1.  Went to sleep and woke up at a reasonable hour!  Slowly getting my sleep schedule back on track feels great because then I can actually be productive and live like a normal person.\\n2.  Finally fully completed a project that I\'m quite proud of.  I thought I was done before, but the results didn\'t look very good and I was a little confused.  I found out that I had made a mistake, but fixing it and seeing that the results were really great was empowering.\\n3.  Got dinner with my little!  It\'s been a long time.\"\n      },\n\n      {\n        date: \"12/9/14\",\n        body: \"1.  Successfully resolved some miscommunications and issues that I had with one of my project groups.  I was a little annoyed and worried that there\'d be a lot of conflict, but I was happy that I handled the situation well.\\n2.  I grabbed dinner with one of my best friends at Berkeley after not having seen him for a while, it was fun to just hang out and chat and talk about how we enjoy being fat sometimes.\\n3.  I went to the gym and started doing [Ice Cream Fitness](http://www.muscleandstrength.com/workouts/jason-blaha-ice-cream-fitness-5x5-novice-workout) again, after deciding that the split I was doing before wasn\'t really working as well as I had hoped (not really making significant strength gains and not really getting buffer either).  The first workout was long but a lot of fun, especially since I hadn\'t been able to go to the gym for a long time.\"\n      },\n\n      {\n        date: \"12/6/14\",\n        body: \"1.  Was able to go watch my younger cousin test for blackbelt this morning.  I was a little disappointed that she hadn\'t made quite as much progress as I hoped, but it was a lot of fun to watch some taekwondo action again.  I haven\'t been out of taekwondo for *that* long, in reality, but it feels like it has been forever, and it inspired me to keep working towards my own fitness goals (and made me want to be flexible again...)\\n2.  Worked out right after, and thinking about things that have transpired recently, I realized again that I really do love working out, and as part of my motion to start doing things for me, not for others, I should really be spending more time at the gym and try to really push myself.  I\'ve gotten pretty comfortable with my routine and I haven\'t been making that much progress.  It\'s time to overhaul it a little bit, or just try to deload everything and then go hard again.\\n3.  Ate some crackers with pepperoni and salami, and it tasted *really* good.\"\n      },\n\n      {\n        date: \"12/5/14\",\n        body: \"1.  Posted a photo I really liked on Instagram, and got a decent amount of positive comments and likes.  I took the photo yesterday impulsively but I thought it had a lot of potential, and when I was editing it yesterday I was able to add a lot of brightness and contrast.  It was really rewarding, because photography (and in general, artsy-crafty things) is something I want to improve at, and positive feedback encourages me to continue shooting.\\n2.  Got lunch with a friend.  I haven\'t seen him for a while and it was nice to just hang out and eat some pretty tasty food together.  It just reminded me that connecting with people I like, even if we don\'t really have much to specifically talk about, is nice.\\n3.  Went to retreat and had some great chats.  I was really annoyed with having to go to retreat before, because I have been feeling really disconnected with Theta Tau recently.  However, I was more or less forced to go to retreat because I had put my car down as a ride, and the four people I was supposed to drive would have no way to get there if I didn\'t drive.  I was kind of an asshole during the ride up because I didn\'t really want to go.  However, when I got there, I really enjoyed talking to some people, a few of them who I normally wouldn\'t have any long or meaningful conversation with.  It made me realize that though I don\'t really believe in what the fraternity does, I can still believe in the quality and goodness of some of the members.\"\n      }\n    ];\n\n    __exports__[\"default\"] = Ember.Route.extend({\n      model: function() {\n        return {\n          threeGoodThings: threeGoodThings\n        };\n      }\n    });\n  });//# sourceURL=website/routes/three-good-things.js");

;eval("define(\"website/routes/writing\", \n  [\"ember\",\"exports\"],\n  function(__dependency1__, __exports__) {\n    \"use strict\";\n    var Ember = __dependency1__[\"default\"];\n\n\n    var blogPosts = [\n      {\n        title: \"It\'s a scary world out there!\",\n        date: \"2/19/14\",\n        image: \"/assets/images/city-mini.jpg\",\n        body: \"My roommate recently has been having a little trouble finding an internship for this summer.  He is an intelligent, hardworking, and motivated student.  Wanting to help him, I suggested that he email me his resume so I could forward it to the recruiter at the company I\'m working for this summer.  But he declined, citing that doing so didn\'t feel fair.\\n\\nI can\'t for the life of me understand why doing this would be unfair.  I tried to explain to him my thoughts.  Recruiters are paid to pair high-caliber candidates with empty job positions.  If I know a person who wants work, and a person who wants talent, then what is unfair about me trying to facilitate dialogue between them?\\n\\nI think one reason is that people don\'t like to rely on other people.  We all have this desire to try and make it on our own, to be our own boss.My roommate probably doesn\'t want to owe me anything, or to think that he wasn\'t capable enough to find an internship by himself.  But I feel that this is a flawed, egoistical mindset.\\n\\nAsking someone for a favor isn\'t as big of an inconvenience as most perceive.  Contrarily, people who do favors for you tend to be more readily approachable or friendly to you; this psychological finding has been dubbed the [Benjamin Franklin effect](http://en.wikipedia.org/wiki/Ben_Franklin_effect), and has made its way into plenty of self-help books.  It\'s a surprising realization, and an underestimated tool to start building relationships.\\n\\nPersonally, I think that networking _is_ a skill &mdash; and making relationships and leveraging them isn\'t anything to be ashamed of.  I\'m a firm believer that a person\'s value includes the relationships and network that they have in addition to their tangible skills.  Not everyone is equally friendly and outgoing, and I think that being able to connect to people is just as useful as any \'real\' skill.  You might be a top developer, but if no one can get along with you, who\'d want to work with you on a project?\"\n      }\n    ];\n\n\n    __exports__[\"default\"] = Ember.Route.extend({\n      model: function() {\n        return {\n          blogPosts: blogPosts\n        };\n      }\n    });\n  });//# sourceURL=website/routes/writing.js");

